CREATE TABLE "dev"."main"."q20" AS SELECT s_name, s_address FROM "dev"."tpch"."supplier", "dev"."tpch"."nation" WHERE s_suppkey IN (SELECT ps_suppkey FROM "dev"."tpch"."partsupp" WHERE ps_partkey IN (SELECT p_partkey FROM "dev"."tpch"."part" WHERE p_name LIKE 'forest%') AND ps_availqty > (SELECT 0.5 * SUM(l_quantity) FROM "dev"."tpch"."lineitem" WHERE l_partkey = ps_partkey AND l_suppkey = ps_suppkey AND l_shipdate >= CAST('1994-01-01' AS DATE) AND l_shipdate < CAST('1995-01-01' AS DATE))) AND s_nationkey = n_nationkey AND n_name = 'CANADA' ORDER BY s_name NULLS FIRST